{"Explanation":"
The speed of the person doing the jumping jacks has a lot to do with if the dominoes fall down or not. If the person doing the jumping jacks is moving at a very high speed, then of course the dominoes will fall over. If the person is moving verv slow and deliberately then the dominoes will not fall. It also has to do with how close or far away they are from  the Domino’s.  

If they are close enough to the dominoes then they will fall. if they are far away from the Domino’s and the dominoes can not detect the motion of the person doing the jumping jacks, then they will not fall over."}
